            <div class="mfContent">
                <div class="mfTrigger0 text-center">
                    <h1>Global Commerce Customized<br>for Your Business</h1>
                    <p>Your business deserves a commerce solution as unique as your products and as special as your
                        customers. That's why we offer flexible API architecture so you can assemble a best-of-breed
                        solution, purpose-built for global growth and security.</p>
                    <a href="#mfTrigger1" id="mfScroll">Scroll to learn more</a>
                </div>
                <div class="mfTrigger1">
                    <h2>Shopper Experience</h2>
                    <p>Nobody knows your customers better than you – their preferences, their buying habits. Find a
                        content management system (CMS) or digital experience platform (DXP) that provides the
                        flexibility needed to build seamless, customizable shopper experiences.</p>
                    <p>CMS & DXP PARTNERS WE WORK WITH:</p>
                    <div class="partnerLogos">
                        <a href="/partners/wordpress"><img
                                    src="<?= get_stylesheet_directory_uri() . '/vendor/mf-interactive/img/WordPress-logo.svg' ?>"
                                    alt="WordPress"></a>
                        <img src="<?= get_stylesheet_directory_uri() . '/vendor/mf-interactive/img/Adobe-logo.svg' ?>"
                             alt="Adobe">
                    </div>
                </div>
                <div class="mfTrigger2">
                    <h2>Commerce</h2>
                    <p>There's no such thing as a “one-size-fits-all” commerce solution. Are you a digital business
                        selling subscriptions or shipping physical products cross border? Which countries are you
                        looking to expand into – now and in the future? <a
                                href="/headless-commerce-move-monolithic-best-breed/">And what the heck is headless
                            commerce?</a></p>
                    <p>Use our Commerce platform, or connect our Order Management and Payments & Risk solutions to other
                        industry-leading commerce providers to build a sophisticated solution scaled for global
                        growth.</p>
                    <p>COMMERCE PARTNERS WE WORK WITH:</p>
                    <div class="partnerLogos">
                        <a href="/partners/magento">
                            <img src="<?= get_stylesheet_directory_uri() . '/vendor/mf-interactive/img/Magento-logo.svg' ?>"
                                 alt="Magento">
                        </a>
